import React from 'react';
import './CS.css';

const Programs = () => {
  return (
    <div className="programs">
      <h2>Computer Systems Engineering Programs</h2>
      <p>Here you can detail the programs offered by the Computer Systems Engineering department, such as undergraduate and postgraduate degrees, along with brief descriptions or links to more detailed information.</p>
      {/* Add more content about programs here */}
    </div>
  );
};

export default Programs;
